import React, { Component } from "react";
import { Table } from "react-bootstrap";

export class Department extends Component {
  constructor(props) {
    super(props);
    this.state = { deps: [] };
  }
  render() {
    return (
      <div className="mt-5 d-flex justify-content-left">
        <h3>This is the Department page.</h3>
      </div>
    );
  }
}
